INSERT INTO `gms_admin` VALUES ('admin', '123456');
INSERT INTO `gms_notice` VALUES ('0279046b3a3a446f8fe2c42dac7b1468', '2020-05-17', 'admin', '体育馆场地管理系统用户登录界面和管理员模块登录界面搭建完成!!!   两个登陆界面，主要采用的是div+css+jquery完成设计，实现基本的校验功能以及在一个界面跳转的功能，给用户更好的体验，同时也给管理员更清晰，直观的界面感受。', '前后台登录界面搭建完成', 0);
INSERT INTO `gms_notice` VALUES ('2adf4591ac594192b4ff51a23e655c59', '2020-05-20', 'admin', '体育馆场地管理系统用户预约订单和管理员模块情况分析界面搭建完成!!!  预约订单是通过bootstrap布局和表格展示具体所预约的信息，可以选择取消预约和提交订单两个选择。管理员情况分析是通过chart实现图片动态化和详情展示的功能。', '预约订单和情况分析界面搭建完成', 0);
INSERT INTO `gms_notice` VALUES ('3688955e756f44c39d3e16eaa3425493', '2020-05-23', 'admin', '体育馆场地管理系统用户订单详情和管理员模块总览界面搭建完成!!!  用户个人中心是通过bootstrap的分页和模态框一起实现用户取消预约，信息查看和修改密码等功能。管理员通过Chart.bundle.min.js和ifream布局展示后台总体情况。', '个人中心和模块总览界面搭建完成', 0);
INSERT INTO `gms_notice` VALUES ('839e3bd5b9a447b28e31932d4aa3ab77', '2020-05-25', 'admin', '体育馆场地管理系统用户场地信息和管理员通知发布界面搭建完成!!!  用户模块是通过整体bootstrap布局，用tab标签页列出所有场地信息并实现异步跳转功能，增加用户体验。管理员模块通过bootstrap布局，ifream实现跳转。通知栏展示通知信息和发布通知信息。', '场地信息和通知发布界面搭建完成', 0);
INSERT INTO `gms_notice` VALUES ('89c0a6d29fed418380a50a4de73ad239', '2020-05-31', 'admin', '体育馆场地管理系统用户通知发布界面和管理员模块预约查询界面搭建完成!!!  用户通知界面是和产地信息一起布局在通过一个row里面，偏右侧。侧栏实现需要通知的消息。管理员的预约查询是通过同样的方式实现跳转功能。', '通知发布和预约查询界面搭建完成', 0);
INSERT INTO `gms_notice` VALUES ('92cee889b2eb41c8b88ca508e210f2b7', '2020-06-05', 'admin', '体育馆场地管理系统用户场地展示和管理员模块场地管理界面搭建完成!!!  用户场地展示是展示每个标签页所对应的具体场馆类型一句场馆预约信息。管理员场地管理通过舔砖方式和表格展示实现对每个场馆进行增删改查。', '场地展示和场地管理界面搭建完成', 0);
INSERT INTO `gms_notice` VALUES ('b94a4c7752854b3c8bccf7a939df1d44', '2020-06-10', 'admin', '体育馆场地管理系统数据设计完成!!!    我们通过对场馆信息的具体分析和逻辑分析，设计好具体的数据库说明书和展示ER图，数据库关系图等。通过数据库的实现和前面的所有需求分析，概要设计等报告实现前后台编码。', '数据设计完成', 0);
