INSERT INTO `gms_type` VALUES ('乒乓球场', 'admin', '航空港西北运动区乒乓球场地', '学校西北运动区乒乓球场地覆盖面积有四分之一个足球场，和羽毛球场地公用同一个场地，是最靠近学校情人坡的场地...');
INSERT INTO `gms_type` VALUES ('排球场', 'admin', '航空港西北运动区排球场地', '学校西北运动区排球场地覆盖面积和乒乓球场地大小相当，位于网球场和篮球场中间，运动氛围很足，环境很棒...');
INSERT INTO `gms_type` VALUES ('篮球场', 'admin', '航空港西北运动区篮球场地', '学校西北运动区篮球球场地覆盖面积和田径场相当，有两个场地，位于银杏大道两侧，冬季还可以有银杏作伴...');
INSERT INTO `gms_type` VALUES ('网球场', 'admin', '航空港西北运动区网球场地', '学校西北运动区网球场地覆盖面积和乒乓球场相当，位于羽毛球场地和排球场之间，由于平时访问量少，所以平时都很安静...');
INSERT INTO `gms_type` VALUES ('羽毛球场', 'admin', '航空港西北运动区羽毛球场地', '学校西北运动区羽毛球球场地和乒乓球场地在一起，虽然不是最靠近情人坡的地方，但是离吃狗粮也不远了...');
